import React from 'react';
import { Link } from 'react-router-dom';
import { Navbar, Nav, NavItem,NavLink, Button, Col, Row } from 'react-bootstrap';
import { LinkContainer } from 'react-router-bootstrap'
import { SHOP_NAME } from '../constant';
import logo from '../asset/image/logo.png';
import './navigation.css';

export default class Navigation extends React.Component {
    navbar = { backgroundColor: '#F16E10 !important' };
    render() {
        return <Navbar className="color-nav" expand="lg">
            <Navbar.Brand href="/">
                <img
                    src={logo}
                    width="270"
                    height="45"
                    className="d-inline-block align-top"
                    alt={SHOP_NAME}
                />
            </Navbar.Brand>
            <Navbar.Toggle />
            <Navbar.Collapse id="basic-navbar-nav" >
                <Nav activeKey="/">
                    <Col xs={{span:12}}>
                        <Row>
                            <Col md={{ span: 3, offset: 3 }}>
                                <LinkContainer to="/">
                                <NavItem><NavLink>main</NavLink></NavItem>
                                    <Button>Home</Button>
                                </LinkContainer>
                            </Col>
                            <Col md={{ span: 6 }}>
                                <LinkContainer to="/second">
                                    <Button>Second</Button>
                                </LinkContainer>
                            </Col>
                        </Row>
                    </Col>
                    {/* <LinkContainer to="/">
                        <NavItem eventKey={1}>main</NavItem>
                    </LinkContainer> */}
                    {/* <LinkContainer to="/second">
                        <NavItem eventKey={2}>second</NavItem>
                    </LinkContainer>  */}
                </Nav>
            </Navbar.Collapse>
        </Navbar>
    }

}
